import React from 'react';
import './App.css';

class Button extends React.Component{
    RollX(X) {
        const min = 1;
        const max = x;
        const rand = min + Math.random() * (max - min);
        this.setState({ random: this.state.random + rand });
    }

    MoreOptions() {

    }
}

export default Button;
